'use strict';

var randu = require( '@stdlib/random/base/randu' );
var gammaincinv = require( './../lib' );

var a;
var i;
var p;

for ( i = 0; i < 100; i++ ) {
	p = randu();
	a = randu() * 50.0;
	console.log( 'p: %d, \t a: %d, \t P^(-1)(p, a): %d', p.toFixed( 4 ), a.toFixed( 4 ), gammaincinv( p, a ).toFixed( 4 ) );
}
